// src/pages/SkillTreePage.js

import 'react-flow-renderer/dist/style.css';
import 'react-flow-renderer/dist/theme-default.css';

import React from 'react';
import ReactFlow from 'react-flow-renderer';

// Your nodes & edges
const nodes = [
  { id: '1',       type: 'input', data: { label: 'Start Here', credits: 0 },                 position: { x: 250, y: 0   } },
  { id: 'surgery', data: { label: 'Oral Surgery', credits: 0 },                              position: { x: 100, y: 150 } },
  { id: 'ortho',   data: { label: 'Orthodontics', credits: 0 },                              position: { x: 250, y: 150 } },
  { id: 'endo',    data: { label: 'Endodontics', credits: 0 },                               position: { x: 400, y: 150 } },
  { id: 'restor',  data: { label: 'Restorative Dentistry', credits: 0 },                     position: { x: 100, y: 300 } },
  { id: 'implant', data: { label: 'Implant Dentistry', credits: 0 },                         position: { x: 250, y: 300 } },
  { id: 'radio',   data: { label: 'Radiology', credits: 0 },                                 position: { x: 400, y: 300 } },
  { id: 'tmd',     data: { label: 'TMD / Orofacial Pain', credits: 0 },                      position: { x: 250, y: 450 } },
];

const edges = nodes
  .filter(n => n.id !== '1')
  .map(n => ({
    id: `e1-${n.id}`,
    source: '1',
    target: n.id,
    animated: true,
  }));

export default function SkillTreePage() {
  console.log('üîç Rendering SkillTreePage with nodes:', nodes.length);
  return (
    // Make this container full viewport width & height
    <div style={{ width: '100vw', height: '100vh' }}>
      {/* Debug header */}
      <h1 style={{
        position: 'absolute', top: 10, left: 10, zIndex: 10,
        background: 'white', padding: '4px 8px', border: '1px solid #ccc'
      }}>
        üõ†Ô∏è Skill Tree Loaded
      </h1>

      <ReactFlow
        elements={[...nodes, ...edges]}
        fitView
        // Force ReactFlow to fill 100% of its parent
        style={{ width: '100%', height: '100%' }}
      />
    </div>
  );
}
